package iimage

import (
	"bytes"
	"fmt"
	"image/png"
	"log"
	"os"
	"testing"
)

func TestBufferToBase64(t *testing.T) {
	file, _ := os.Open("test.png")
	m, _ := png.Decode(file)
	file.Close()
	// Do any adjustments to the image you need to
	// here such as resize and any filters
	// you might apply to the image

	var b bytes.Buffer
	png.Encode(&b, m)

	img := BufferToBase64(b)
	fmt.Println(img)
}

func TestLocalFileToBase64(t *testing.T) {
	img, _ := LocalFileToBase64("test.png")
	fmt.Println(img)
}

func TestBase64ToLocalFile(t *testing.T) {
	str := `data:image/png;base64,`

	log.Println(Base64ToLocalFile(str, "/tmp/exp.jpg"))
}
